import React, { useState } from "react";
import Login from "./components/Login";
import ForgotPassword from "./components/ForgotPassword";

function App() {
  const [page, setPage] = useState("login");

  return (
    <div>
      {page === "login" && <Login onNavigate={() => setPage("forgot-password")} />}
      {page === "forgot-password" && <ForgotPassword onNavigate={() => setPage("login")} />}
    </div>
  );
}

export default App;
